webpackJsonp([0xa88e662685e0],{6486:function(e,t){e.exports={data:{post:{html:"<p>The evening news on ZDF was pre-empted for 'Unsere Besten', the poll of the 100 Greatest Germans based on a similar program on BBC. Even though the names were not limited to the 20th century, there was still a huge hole from the Nazi period. For those who are interested how Germans view their own history, the top 10 in alphabetical order are</p>\n<p>Konrad Adenauer<br />\nJohann S. Bach<br />\nOtto v. Bismarck<br />\nWilli Brandt<br />\nAlbert Einstein<br />\nJohann W. Goethe<br />\nJohannes Gutenberg<br />\nMartin Luther<br />\nKarl Marx<br />\nHans &amp; Sophie Scholl</p>\n<p>All seem worthy, but I'd personally vote for the Scholls, founders of the White Rose resistance during the Third Reich.</p>",fields:{title:"The Greatest Germans?",date:"07 Nov 2003",url:"https://papascott.de/2003-11-07-the-greatest-germans/"}}},pathContext:{slug:"/2003-11-07-the-greatest-germans/",prev:{fields:{title:"Our IT guy knows his shit.... and he didn't download the porn",date:"07 Nov 2003",slug:"/2003-11-07-our-it-guy-knows-his-shit-and-he-didnt-download-the-porn/"}},next:{fields:{title:"6 girls and a case of beer at ebay.de",date:"08 Nov 2003",slug:"/2003-11-08-6-girls-and-a-case-of-beer-at-ebayde/"}}}}}});
